import padsData from './pads';
import styles from './style/pads.module.css';
import React, {useState} from 'react';

function App() {

  const [pads, setPads] = useState(pads);

  const buttonElements = pads.map(pad => (
    <button key={pad.id} className={styles.padButton}>{pad.label} </button>
  ))
   return (
        <main>
            <div className={styles.padContainer}>
                {buttonElements}
            </div>
        </main>
    );
}

export default App;
